style.css:
@-moz-document domain("starserial.ru") {
.ss-content {
    background-color: #202020;
}

.ss-Post {
    background-color: #202020;
}

.ss-Post-cc {
    background-color: #101010;
}

.ss-Post-tl, .ss-Post-tr, .ss-Post-bl, .ss-Post-br, .ss-Post-tc, .ss-Post-bc, .ss-Post-cl, .ss-Post-cr {
    background-image:url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAEnQAABJ0Ad5mH3gAAAANSURBVBhXYwgLC/sPAAQKAgIoLHdRAAAAAElFTkSuQmCC');
}

.ss-PostHeader {
    font-size: 18px;
    color: #eaeaea;
}

.ss-PostHeader a, .ss-PostHeader a:link, .ss-PostHeader a:visited, .ss-PostHeader a:hover {
    font-size: 18px;
    color: #eaeaea;
}

h2, h2 a, h2 a:link, h2 a:visited, h2 a:hover {
    color: #b9b9b9;
}

h4, h4 a, h4 a:link, h4 a:visited, h4 a:hover {
    color: #a9aacc;
}

.ss-article table, table.ss-article .ss-article tr, .ss-article th, .ss-article td {
    color: #a9aacc;
    font-size: 7px;
}

.ss-BlockHeader .t {
    color: #cce3ff;
}

.ss-BlockHeader .l, .ss-BlockHeader .r {
    background-image:url('data:image/png;base64,');
}

.ss-BlockContent-tl, .ss-BlockContent-tr, .ss-BlockContent-bl, .ss-BlockContent-br, .ss-BlockContent-tc, .ss-BlockContent-bc, .ss-BlockContent-cl, .ss-BlockContent-cr {
    background-image:url('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAEnQAABJ0Ad5mH3gAAAANSURBVBhXYwgLC/sPAAQKAgIoLHdRAAAAAElFTkSuQmCC');
    opacity: 0.4;
}

.ss-BlockContent-cc {
    background-color: #101010;
}

.ss-BlockContent-body a:link {
    color: #b1b1b1;
}

.ss-BlockContent-body {
    color: #9590e6;
}

.ss-BlockContent-body ul {
    color: #a2b5e0;
}

.ss-PostContent, .ss-PostContent p {
    color: #8e9ecc;
}
}
